    "## About me <a class=\"anchor\"  id=\"aboutme\"></a>\n",
    "I am a recent graduate from Boston College with a degree in Computer Science and I wanted to learn more about data analysis so I completed Google's Data Analysis Certificate program this summer. This case study is the capstone project for the course and my first data analysis project!\n",
    "\n",
    "I will be using the 6 phases of analysis (Ask, Prepare, Process, Analyse, Share and Act)to help guide my process. "
   ]
  },
