    "## 3.1 About the data <a class=\"anchor\"  id=\"aboutsource\"></a>\n",
    "I will be using the public [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit). This data contains personal fitness tracker data spanning over one month (4.12.16 to 5.12.16) from 30 different users. Thirty eligible Fitbit users consented to the submission of personal\n",
    "tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information\n",
    "about daily activity, steps, and heart rate that can be used to explore users’ habits.\n",
    "\n",
    "The data initally contains 18 different datasets but after reviewing, I will only use 5 that focus on daily and hourly calorie, intensity, step, and sleep information that will best help me best analyze user trends."
   ]
  },
