   "source": [
    "## 3.2 Limitations  <a class=\"anchor\"  id=\"limits\"></a>\n",
    "The dataset's sample size is pretty small (~30 users). Additonally, this data contains no information on the user demographics so we have no idea what kind of user is being reported or whether this data is representative of the population as a whole. The data was collected from April 12, 2016 to May 12, 2016 so it may be unrepresentative of trends today. One positive is that we can trust the reliability as FitBits automatically upload the data so we can assume it's unbiased as it's not self-reported. \n",
    "\n",
    "Overall, the data is very limited so I will aim to a provide high-level analysis for Bellabeat. Further research would include using more recent data with a larger sample size in order to fully support an extensive analysis of fitness tracker usage trends."
   ]
  },
