    "user_avgs <- daily_activity_merged %>%  group_by(Id) %>% \n",
    "    summarize(avg_steps = mean(TotalSteps),\n",
    "              avg_calories=mean(Calories),\n",
    "              avg_distance = mean(TotalDistance), \n",
    "              avg_veryActiveMins = mean(VeryActiveMinutes),\n",
    "              avg_fairlyActiveMins = mean(FairlyActiveMinutes),\n",
    "              avg_lightActiveMins = mean(LightlyActiveMinutes),\n",
    "              avg_sedentaryMins = mean(SedentaryMinutes),\n",
    "              avg_minsAsleep = mean(TotalMinutesAsleep,na.rm = TRUE))\n",
    "\n",
    "head(user_avgs)"
   ]
