   "source": [
    "p1 <- ggplot(daily_activity_merged, aes(x = TotalSteps , y = Calories)) +\n",
    "    geom_point() +\n",
    "    geom_smooth(method = \"lm\", formula = y ~ poly(x, 2)) +\n",
    "    labs(title = \"Calories vs. Steps\")\n",
    "\n",
    "p2 <- ggplot(daily_activity_merged, aes(x = Calories , y = TotalMinutesAsleep)) +\n",
    "    geom_point() +\n",
    "    geom_smooth(method = \"lm\", formula = y ~ poly(x, 2)) +\n",
    "    labs(title = \"Minutes Asleep vs. Calories\")\n",
    "\n",
    "p1 + p2"
   ]
  },
