    "types_pie_chart <- ggplot(category_counts, aes(x = \"\", y = count, fill = user_type)) +\n",
    "  geom_bar(stat = \"identity\", width = 1) +\n",
    "  coord_polar(\"y\", start = 0) +\n",
    "  theme_void() +\n",
    "  geom_text(aes(label = paste0(user_type,\": \", count, \"\\n\",round(percentage, 1), \"%\")), position = position_stack(vjust = 0.5)) +\n",
    "  labs(title = \"Distribution of Activity Levels\")\n",
    "\n",
    "# Display the pie chart\n",
    "print(types_pie_chart)"
   ]
  },
