    "daily_activity_merged$Weekday <- weekdays(daily_activity_merged$ActivityDate)\n",
    "\n",
    "daily_activity_merged$Weekday <- factor(daily_activity_merged$Weekday,\n",
    "    levels = c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\"))"
   ]
  },
