   "source": [
    "da_weekday <- daily_activity_merged %>% group_by(Weekday) %>% \n",
    "    summarize(AverageSteps = mean(TotalSteps),\n",
    "             AverageCals = mean(Calories),\n",
    "             AverageMinsAsleep = mean(TotalMinutesAsleep, na.rm = TRUE))"
   ]
  },
