    "p3 <- ggplot(data = da_weekday) + \n",
    "    geom_col(mapping=aes(x=Weekday,y=AverageSteps,fill=Weekday)) +\n",
    "    labs(title = \"Average # of Steps\") +\n",
    "    geom_hline(yintercept = 10000, color = \"red\", linetype = \"dashed\")\n",
    "\n",
    "p4 <- ggplot(data = da_weekday) + \n",
    "    geom_col(mapping=aes(x=Weekday,y=AverageCals,fill=Weekday)) +\n",
    "    labs(title = \"Average # of Calories\")\n",
    "\n",
    "p5 <- ggplot(data = da_weekday) + \n",
    "    geom_col(mapping=aes(x=Weekday,y=AverageMinsAsleep,fill=Weekday)) +\n",
    "    labs(title = \"Average Mins Asleep\") +\n",
    "    geom_hline(yintercept = 420, color = \"red\", linetype = \"dashed\")"
   ]
