   "source": [
    "### Takeaway 2:\n",
    "#### The data shows that there wasn't a significant disparity between weekdays and weekends in terms of average daily steps and calories burned, with Saturday and Tuesday having slightly higher averages. Wednesday and Sunday stood out in terms of sleep, possibly reflecting a \"catch-up\" day on Sunday, although overall sleep duration was still below the recommended amount.\n",
    "\n",
    "I expected to see a wider disparity on weekdays vs. weekends but the data showed that the averages weren't too different across different days. The average # of steps stayed in the lightly active/fairly active range each week day with the highest being Saturday and Tuesday. Saturday makes sense as people are most likely to have that day free of work and use it for fun activities which may require more walking than normal.\n",
    "\n",
    "The calories also had a balanced distribution across weekdays, with again, slightly higher averages on Saturdays and Tuesdays.\n",
    "\n",
    "Saturdays got about an hour more on average for sleep. Sunday makes sense as most people would use that as their \"catch-up\" day and want to get a good start to the work week. Only 4/7 nights had on average 7 hours of sleep which is not quite the recommended amount. We will look at sleep more in-depth later on."
   ]
  },
