   "source": [
    "According to Fitabase's [Data Dictionary](https://www.fitabase.com/media/1930/fitabasedatadictionary102320.pdf), the description for the following data types are:\n",
    "* **TotalIntensity**: Value calculated by adding all the minute-level intensity values that occurred within the hour.\n",
    "* **AverageIntensity**: Average intensity state exhibited during that hour (TotalIntensity for that ActivityHour divided by 60)."
   ]
  },
  {
   "cell_type": "markdown",
   "id": "12fa33b1",
   "metadata": {
    "papermill": {
     "duration": 0.028694,
