   "source": [
    "hourly_summary <- hourly_merged %>%\n",
    "  group_by(Hour) %>%\n",
    "  summarize(\n",
    "    AvgTotalIntensity = mean(TotalIntensity),\n",
    "    AvgIntensity = mean(AverageIntensity),\n",
    "    AvgCalories = mean(Calories),\n",
    "    AvgStepTotal = mean(StepTotal)\n",
    "  )"
