    "### Takeaway 3.1\n",
    "#### We can see the the hourly average calories, step totals, and intensities exhibit a similar pattern, just on different scales.\n",
    "* The line generally increases from early morning until 10am where the the averages flucuate until reaching a peak in early evenings, from 5-7pm. The peak could be due to many people incorporating physical activity into their post-work routine or they might have the most free-time around this time.\n",
    "* The numbers are very low in what we typically consider nighttime hours (11pm-5am) where a body would be sedentary and only burning [40-80](https://naplab.com/guides/how-many-calories-do-you-burn-sleeping/#:~:text=The%20exact%20number%20of%20calories,320%20%E2%80%93%20640%20calories%20per%20night.) calories an hour.\n",
    "\n",
    "I expected there to be higher averages in the mornings around 6-8am due to morning workout people but they are probably a smaller percentage of the users. I will now try to analyze what **time of the day** users tend to workout."
   ]
  },
