    "morning_hours <- 5:9 #5 am to 9am\n",
    "night_hours <- 17:21 #5 pm to 9pm\n",
    "\n",
    "add_hours <- hourly_merged %>%\n",
    "    mutate(TimeOfDay = case_when(\n",
    "        Hour %in% morning_hours ~ \"Morning\",\n",
    "        Hour %in% night_hours ~ \"Evening\",\n",
    "        TRUE ~ \"Other\"))"
