    "workout_types_pie_chart <- ggplot(category_counts2, aes(x = \"\", y = count, fill = highestIntensityTime)) +\n",
    "    geom_bar(stat = \"identity\", width = 1) +\n",
    "    coord_polar(\"y\", start = 0) +\n",
    "    theme_void() +\n",
    "    geom_text(aes(label = paste0(round(percentage, 1), \"%\")), position = position_stack(vjust = 0.5),size=7,color=\"white\") +\n",
    "    theme(plot.title = element_text(hjust = 0.5, size=14, face = \"bold\")) +\n",
    "    labs(title = \"Distribution of Users' Highest Intensity Time Period\", fill=\"Time Period\") +\n",
    "    theme(plot.title = element_text(size = 16))\n",
    "\n",
    "print(workout_types_pie_chart)"
   ]
