    "### Takeaway 4.1\n",
    "**Per the plots:**\n",
    "* There is a negative correlation between sedentary minutes and minutes asleep. This could be explained through how extended sedentary behavior has been shown to [disrupt](https://pubmed.ncbi.nlm.nih.gov/27830446/) sleep patterns. \n",
    "* Lightly active and very active minutes had a slight positive correlation while fairly active had a slight negative correlation. \n",
    "\n",
    "Sleep is multi-faceted so I do not want to draw any hard conclusions based off of our limited data but from these charts, I think it is safe to say that too much sedentary time may disrupt sleep and adding some lightly active exercise into your life can help one's sleep as the plot shows the trend line right around the recommended 7.5 hours of sleep."
   ]
