   "source": [
    "user_avgs <- user_avgs %>%\n",
    "  mutate(sufficient_sleep = ifelse(avg_minsAsleep >= 420,\"yes\",\"no\"))\n",
    "\n",
    "sleep_count <- user_avgs %>%\n",
    "  group_by(sufficient_sleep) %>%\n",
    "  summarise(count = n())\n",
    "\n",
    "total <- sum(sleep_count$count)\n",
    "\n",
    "sleep_count <- sleep_count %>%\n",
    "  mutate(percentage = count / total * 100)\n",
    "\n",
    "sleep_count"
   ]
  },
