    "p14 <- ggplot(sleep_count3, aes(x = \"\", y = count, fill = sufficient_sleep)) +\n",
    "    geom_bar(stat = \"identity\", width = 1) +\n",
    "    coord_polar(\"y\", start = 0) +\n",
    "    theme_void() +\n",
    "    geom_text(aes(label = paste0(round(percentage, 1), \"%\")), position = position_stack(vjust = 0.5),size=6,color=\"white\") +\n",
    "    labs(title = \"Distribution of Users Meeting 7+ Hours of Sleep\")+\n",
    "    theme(legend.text = element_text(size = 14), \n",
    "        legend.title = element_text(size = 14),\n",
    "        plot.title = element_text(hjust = 0.5, size=14, face = \"bold\"))\n",
    "p14"
