    "**Based on the users who recorded their sleep:**\n",
    "* There isn't an overarching trend of increased sleep overtime. As always, there are multiple factors in play that could prevent a consistent full seven hours of sleep, as shown in the wide flucuations on the plots.\n",
    "* There are a lot of gaps in the data. This could mean that users don't find their sleeping activity as significant as their daily physical activity or maybe it's harder to track. This leads us to our final stage of analysis: Fitbit usage."
