   "source": [
    "We will also assign a **usage category** to each user based on their number of days recorded, we can then use this to analyze how active our users were through a pie chart:"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 53,
   "id": "f5a7244d",
   "metadata": {
    "execution": {
