     "end_time": "2023-10-15T02:53:15.031722",
     "exception": false,
     "start_time": "2023-10-15T02:53:14.957485",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "daily_activity_usage <- merge(daily_activity_merged, daily_usage, by=\"Id\")\n",
    "\n",
    "daily_activity_usage <- daily_activity_usage %>%\n",
    "  mutate(Usage = case_when(\n",
    "    DaysRecorded >= 21 ~ \"High Use\",\n",
    "    DaysRecorded >= 11 ~ \"Moderate Use\", \n",
    "    DaysRecorded <= 10 ~ \"Low Use\"\n",
    "  ))\n"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 54,
   "id": "aa03b0ab",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2023-10-15T02:53:15.124661Z",
     "iopub.status.busy": "2023-10-15T02:53:15.122975Z",
     "iopub.status.idle": "2023-10-15T02:53:15.151058Z",
     "shell.execute_reply": "2023-10-15T02:53:15.149033Z"
    },
    "papermill": {
     "duration": 0.078834,
     "end_time": "2023-10-15T02:53:15.154104",
     "exception": false,
     "start_time": "2023-10-15T02:53:15.075270",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "unique_counts <- daily_activity_usage %>% distinct(Id, .keep_all = TRUE)\n",
    "\n",
    "usage_counts <- unique_counts %>%\n",
    "    group_by(Usage) %>%\n",
    "    summarise(Count = n())\n",
    "\n",
    "usage_counts <- usage_counts %>% mutate(Percentage = Count / 33 * 100)"
   ]
  },
