   "outputs": [],
   "source": [
    "p16 <- ggplot(usage_counts, aes(x = \"\", y = Count, fill = Usage)) +\n",
    "    geom_bar(stat = \"identity\", width = 1) +\n",
    "    coord_polar(theta = \"y\") +\n",
    "    theme_void() +\n",
    "    theme(plot.title = element_text(hjust = 0.5, size=14, face = \"bold\")) +\n",
    "    geom_text(aes(label = paste0(round(Percentage, 1), \"%\")),position = position_stack(vjust = 0.5)) +\n",
    "    labs(fill = \"Usage\") +\n",
    "    scale_fill_discrete(labels=c('High Use: 21-31 days', 'Moderate Use: 11-20 days', 'Low Use: 0-10 days')) +\n",
    "    labs(title=\"Fitness Tracker Usage Distribution\")"
   ]
  },
