   "source": [
    "daily_activity_usage$TotalTimeRecorded <- rowSums(daily_activity_usage[, c(\"VeryActiveMinutes\", \"FairlyActiveMinutes\", \"LightlyActiveMinutes\",\"SedentaryMinutes\")], na.rm = TRUE)\n",
    "\n",
    "daily_activity_usage <- daily_activity_usage %>% mutate(Percentage = TotalTimeRecorded / 1440 * 100)\n",
    "\n",
    "daily_activity_usage <- daily_activity_usage %>%\n",
    "  mutate(Worn = case_when(\n",
    "    Percentage == 100 ~ \"All Day\",\n",
    "    Percentage >= 50 ~ \"More Than Half Day\", \n",
    "    Percentage < 50 ~ \"Less Than Half Day\"\n",
    "  ))\n",
    "\n",
    "head(daily_activity_usage)"
   ]
  },
