    "**Per the charts**\n",
    "* We can see that *high use* users will either wear their watch all day (45.5%) or more than half a day (51.8%) \n",
    "    * They only wear it for less than half a day 2.7% of the time.\n",
    "* The *moderate use* group is similar to the high use group except they are even less likely to wear their trackers for less than half a day (only 1.6%)\n",
    "* Surprisingly, when *low use* users wear their FitBit they are unlikely to wear it less than half a day and instead wear it:\n",
    "    * Full-day: 2/3 of the time worn\n",
    "    * More than half a day: 1/3 of the time worn\n",
    "\n",
    "### Takeaway 5.3\n",
    "Overall, we see that when user's wear their Fitbit, they are likely to keep it on for either a full-day/more than half a day, even if they aren't regular users."
   ]
