    "## 6.1 Takeaway Summary  <a class=\"anchor\"  id=\"tsummary\"></a>\n",
    "* **5.1 Overview**\n",
    "    * Fitbit users averaged \n",
    "        7519 steps per day\n",
    "        2292 calories per day\n",
    "        6.28 hrs (377 mins) of sleep per day\n",
    "    \n",
    "* **5.2 Correlations**\n",
    "     * Positive correlation between the number of steps taken and the calories burned\n",
    "     * No correlation between calories burned and minutes spent asleep\n",
    "* **5.3 User Types**\n",
    "    * Users of all activity types use smart devices to track their activity\n",
    "* **5.4 Weekday Breakdown** \n",
    "    * There is more or less a balanced distribution (slightly more on Saturdays and Tuesday) in terms of daily steps and calories over weekdays showing that people like to be active all days of the week.\n",
    "    * Sunday stood out in terms of sleep, possibly reflecting a \"catch-up\" day on Sunday,\n",
    "* **5.5 Hourly Breakdown** \n",
    "    * Peak activity hours are in the evenings from 5-7 pm.\n",
    "    * Almost 70% of the users preferred to engage in physical activity in the evenings from 5pm-9pm.\n",
    "* **5.6 Sleep Activity**\n",
    "    * Negative correlation between sedentary minutes and minutes asleep.\n",
    "    * Only 72% of the users recorded their sleep data at least once.\n",
    "    * Over 50% of users that tracked their sleep are not getting the recommended seven hours of sleep.\n",
    "* **5.7 Tracker Usage**\n",
    "    * No overarching trend of users increasing their activity levels as the month went on\n",
    "    * Most (75.8%) users utilized their fitbits 21 or more days in the month-long period\n",
    "        * Only 42.4% of users recorded all 31 days\n",
    "    * When users wear their Fitbit, they are likely to keep it on for either a full-day/more than half a day, even if they aren't regular users.\n",
    "\n",
    "\n",
    "    "
   ]
